import React, { Component } from 'react';
import './Team.css';
import {NavBar} from "../component/AppBar"
import Team_member from "../component/Team_member"
class Team extends Component{
    render(){
        return(
            <div id="Team_container">
                <NavBar/>
                <div id="Team_content">
                    <div id="Team_title_hr">History Team</div>
                    <div id="Team_B06">
                        <div id="Team_B06_title_hr">B06</div>
                        <div id="Team_B06_leader">Leaders:</div>
                        <div id="Team_B06_frontend">Front-End Developers:</div>
                        <div id="Team_B06_backend">Back-End Developers:</div>
                        <div id="Team_B06_study">Study:</div>
                    </div>
                </div>
            </div>
        )
    }
}
export default Team;
